import React from 'react';
import './App.css';
import {Component} from 'react-simplified';

export class Terminal extends Component{

    addText(){
        console.log("lol");
    }
    render(){
        window.onkeypress =  this.addText();
        return(
            <div className="container">
            <div className="root">
                ~root $
            </div>
            <div class="text">
            </div>
            </div>

        )
    }
}
